export default function Feed() {
  const [posts, setPosts] = useState([]);

  useEffect(() => {
    const fetchPosts = async () => {
      const res = axios.get("posts/timeline/");
    };
  }, []);
  return (
    <div className="feed">
      <input type="text" onChange={(e) => setText(e.target.value)} />
      <div className="feedWrapper">
        <Share />
        {/*Posts.map((p) => (
